/* harmony default export */ __webpack_exports__["default"] = ("<div class=\"content-policy-wrapper\">\n  <p class=\"content-policy-wrapper__title\">{{'Civic Innovation Foundation (“Civis”) Content Policy' | translate}}</p>\n  <p class=\"content-policy-wrapper__subtitle\">{{'(Effective 2nd September 2018. Last Revised 13th August 2019)' | translate}}</p>\n  <div class=\"content-policy-wrapper__policy-detail-container\">\n    <p class=\"dark-text\">\n      {{'This Content Policy explains what kind of content you can share on Civis. \n      At Civis, we believe in open dialogue and freedom of expression, however, \n      we do not tolerate abuse or behavior that promotes hate.' | translate}}\n      <br /><br />\n      {{'While Civis provides considerable leeway in the content it considers acceptable, certain types of content are unwelcome.' | translate}} \n    </p>\n    <section class=\"detail-section\">\n      <p class=\"detail-section__heading\">{{'UNWELCOME CONTENT' | translate}}</p>\n      <p class=\"detail-section__subheading\">{{'Sharing the following types of content on Civis is prohibited:' | translate}}</p>\n      <p class=\"detail-section__content\">\n        <u>{{'Abusive Language:' | translate}}</u>{{'The use of harsh or coarsely insulting language is prohibited.' | translate}}<br /><br />\n        <u>{{'Violence:' | translate}}</u> {{'Making specific threats of violence or wish for the serious physical harm, death, or disease of an individual or group of people is prohibited. Content that glorifies violence or glorifies suffering is prohibited.' | translate}}\n        <br /><br/>\n        <u>{{'Hateful Conduct:' | translate}}</u> {{'You may not promote violence against, threaten, or harass other people on the basis of race, ethnicity, national origin, sexual orientation, gender, gender identity, religious affiliation, age, disability, or serious disease.' | translate}}\n        <br /><br />\n        <u>{{'Confidential Information:' | translate}}</u>{{'You may not post your own personal information or personal information of any other individual in the feedback section of Civis.\n        Posting such information is not permitted, even if consent is granted to post confidential information on the platform.' | translate}}\n        <br /><br />\n        <u>{{'Pornographic or Sexually Explicit Content:' | translate}}</u> {{'Any media that is pornographic and/or may be intended to cause sexual arousal is prohibited.' | translate}} \n        <br /><br />\n        <u>{{'Spam:' | translate}}</u>{{'Spam, defined as any bulk or aggressive activity that attempts to manipulate or disrupt Civis or the experience of users on Civis, is prohibited.' | translate}}\n      </p>\n    </section>\n\n    <section class=\"detail-section\">\n      <p class=\"detail-section__heading\">{{'PROHIBITED BEHAVIOUR' | translate}}</p>\n      <p class=\"detail-section__subheading\">{{'In addition to posting unwelcome content, the following behavior is prohibited on Civis:' | translate}}</p>\n      <p class=\"detail-section__content\">\n        <u>{{'Feedback Manipulation:' | translate}}</u> {{'Feedback manipulation will result in immediate termination of your account. Feedback manipulation includes: ' | translate}}\n        <br /><br />\n        {{'- Using multiple accounts or voting software to manipulate feedback for personal gain.' | translate}}\n        <br /><br />\n        <u>{{'Unlawful Use:' | translate}}</u>{{'You may not use our service for any unlawful purposes or in furtherance of illegal activities.' | translate}}\n        <br /><br />\n        <u>{{'Multiple Accounts:' | translate}}</u>{{'You may not create multiple accounts to evade punishment or avoid restrictions.' | translate}}\n      </p>\n    </section>\n\n    <section class=\"detail-section\">\n      <p class=\"detail-section__heading\">{{'ENFORCEMENT' | translate}}   </p>\n      <p class=\"detail-section__subheading\">{{'Civis has a number of ways of enforcing its Content Policy, these include but are not limited to:' | translate}}</p>\n      <p class=\"detail-section__content\">\n        {{'- Requesting that content guidelines be followed.' | translate}}\n        <br /> <br />\n        {{'- Removal of content and not sharing data with our government and non-governmental partners.' | translate}}\n        <br /> <br />\n        {{'- Temporary or permanent suspension of accounts.' | translate}}\n        <br /> <br />\n        {{'- Permanent termination of an account.' | translate}}\n        <br /> <br />\n        {{'- Banning users.' | translate}}\n      </p>\n    </section>\n  </div>\n</div>\n<app-footer></app-footer>");

