/* harmony default export */ __webpack_exports__["default"] = ("<div class=\"privacy-wrapper\">\n  <div class=\"privacy-wrapper__header\">\n    <p class=\"title\">{{'Civic Innovation Foundation (“Civis”) Privacy Policy' | translate}}   </p>\n    <p class=\"sub-title\">{{'(Effective 2nd September 2018. Last Revised 13th August 2019)' | translate}}   </p>\n  </div>\n  <p class=\"privacy-wrapper__dark-text\">\n    {{'This Privacy Policy describes how your personal information is collected, used, and shared when you visit or share your views on www.civis.vote (the ' | translate}}\n    <b>{{'“Site”' | translate}}</b>\n    {{'), when you use the Site, \n    our mobile application and other online services (collectively, the' | translate}} &nbsp; <b> {{'“Services”' | translate}} </b> \n    {{') or when you otherwise interact with us or receive any communication from us.' | translate}}   \n  </p>\n\n  <div class=\"privacy-wrapper__detail\">\n    <p class=\"detail-title\">{{'INFORMATION YOU PROVIDE TO US' | translate}}   </p>\n    <p class=\"detail-content\">{{'We collect information you provide to us directly when you use the Services. This includes:' | translate}}   </p>\n    <p class=\"detail-content\">\n      <u>{{'Account information:' | translate}} </u> &nbsp; {{'To sign up to the Site, you must create an account. \n      To create an account, you must provide certain information including your name, pin code, gender, date of birth and email address (the' | translate }} <b> {{'“User Information”' | translate }}</b>{{'). \n      We store your User Information along with your user account preferences and settings.' | translate}}   \n    </p>\n    <p class=\"detail-content\">\n      <u>{{'Content you submit:' | translate}} </u> &nbsp; {{'We collect the content you submit to the Services. This includes your posts and comments, your messages to other users of the Site, moderators and to us. Your content may include text, links, images, gifs and videos.' | translate}}   \n    </p>\n    <p class=\"detail-content\">\n      <u>{{'Actions you take:' | translate}} </u> &nbsp; {{'We collect information about the actions you take when using the Services. This includes your interactions with content like voting, posting, saving and reporting content. It also includes your interactions with other users.' | translate}}   \n    </p>\n    <p class=\"detail-content\">\n      <u>{{'Other information:' | translate}}   </u> &nbsp;  \n      {{'We collect information you may choose to provide directly to us by way of filling out a form or participating in other Site activities.' | translate}}   \n    </p>\n  </div> \n\n  <div class=\"privacy-wrapper__detail\">\n    <p class=\"detail-title\">{{'INFORMATION WE COLLECT' | translate}}   </p>\n    <p class=\"detail-content\">\n      {{'When you visit the Site, we automatically collect certain information about your device,including information about your web browser, IP address, time zone, and some of the cookies that are installed on your device.Additionally, as you browse the Site, we collect information about the individual web pages that you view, whatwebsites or search terms referred you to the Site, and information about how you interact with the Site.We refer to this automatically-collected information as “Device Information.”' | translate}}   \n    </p>\n    <p class=\"detail-content\">{{'We collect Device Information using the following technologies:' | translate}}   </p>\n    <p class=\"detail-content\"> \n      {{'- “Cookies” are data files that are placed on your device or computer and often include an anonymous unique identifier. \n      For more information about cookies, and how to disable cookies, visit ' | translate}}    <a href=\"http://www.allaboutcookies.org\" target=\"_blank\">http://www.allaboutcookies.org.</a>\n    </p>\n    <p class=\"detail-content\">\n      {{'- “Log files” track actions occurring on the Site, and collect data including your IP address, browser type, Internet service provider, referring/exit pages, and date/time stamps.' | translate}}   \n    </p>\n    <p class=\"detail-content\">\n      {{'- “Web beacons,” “tags,” and “pixels” are electronic files used to record information about how you browse the Site.' | translate}}   \n    </p>\n    <p class=\"detail-content\">\n      {{'When we talk about “Information” in this Privacy Policy, we are talking both about Device Information and User Information.' | translate}}   \n    </p>\n  </div>\n\n  <div class=\"privacy-wrapper__detail\">\n    <p class=\"detail-title\">{{'HOW WE USE YOUR INFORMATION' | translate}}   </p>\n    <p class=\"detail-content\">{{'We use the User Information that we collect to:-' | translate}}   </p>\n    <p class=\"content-point\">\n      <span>{{'(i)' | translate}}   </span>\n      <span>\n        {{'Understand and analyze demographic trends derived by us from the content you submit and the actions you take. \n        We share this information with governmental and non-governmental organizations with whom we partner. \n        The demographic trends, the content you submit and the actions you take, when submitted, are anonymized and never linked with your account information unless you choose to make your content public;' | translate}}   \n      </span>  \n    </p>\n    <p class=\"content-point\">\n      <span>{{'(ii)' | translate}}   </span>\n      <span>\n        {{'Provide, maintain and improve the Services;' | translate}}   \n      </span>\n    </p>\n    <p class=\"content-point\">\n      <span>{{'(iii)' | translate}}   </span>\n      <span>\n        {{'Monitor and analyze trends, usage and activities in connection with the Services;' | translate}}   \n      </span>\n    </p>\n    <p class=\"content-point\">\n      <span> {{'(iv)' | translate}}</span>\n      <span>\n        {{'Communicate with you; and' | translate}}   \n      </span>\n    </p>\n    <p class=\"content-point\">\n      <span>{{'(v)' | translate}}</span>\n      <span>\n        {{'When in line with the preferences you have shared with us, provide you with information or advertising relating to the Services.' | translate}}  \n      </span>\n    </p>\n\n    <p class=\"detail-content mt-4\">{{'We use the Device Information that we collect to:-' | translate}}</p>\n    <p class=\"content-point\">\n      <span>{{'(i)' | translate}}</span>\n      <span>\n        {{'Help protect the safety of the Site and our users by screening for potential risk and fraud (in particular, your IP address);' | translate}}     \n      </span>\n    </p>\n    <p class=\"content-point\">\n      <span>{{'(ii)' | translate}}</span>\n      <span>\n        {{'Improve and optimize our Site (for example, by generating analytics about how our customers browse and interact with the Site, and to assess the success of our marketing campaigns); and' | translate}}\n      </span>\n    </p>\n    <p class=\"content-point\">\n      <span>{{'(iii)' | translate}}</span>\n      <span>\n        {{'Provide you with information or advertising relating to the Services.' | translate}}\n      </span>\n    </p>\n    <p class=\"detail-content\">{{'We do not share, sell, or give away your Information to third parties otherwise than for the purposes described above.' | translate}}</p>\n  </div>\n\n  <div class=\"privacy-wrapper__detail\">\n    <p class=\"detail-title\">{{'HOW YOUR INFORMATION IS SHARED' | translate}}</p>  \n    <p class=\"detail-content\">\n      {{'We share your Information with third parties when required for the purposes described above.  \n      For example, we use Disqus on our web application --you can read more about how Disqus uses your Information here:' | translate}}\n      <a href=\"https://help.disqus.com/en/articles/1717103-disqus-privacy-policy\" target=\"_blank\">https://help.disqus.com/en/articles/1717103-disqus-privacy-policy.</a>   \n      {{'We also use:' | translate}}\n    </p>\n    <p class=\"content-bullet-point\">\n      <!-- don't remove this empty span -->\n      <span></span> \n      <span>\n        {{'Google Analytics to help us understand how our users use the Site--you can read more about how Google uses your Information here:' | translate}}\n        &nbsp;\n        <a href=\"https://www.google.com/intl/en/policies/privacy/\" target=\"_blank\">https://www.google.com/intl/en/policies/privacy/.</a>   \n        {{'You can also opt-out of Google Analytics here: ' | translate}}<a href=\"https://tools.google.com/dlpage/gaoptout\">https://tools.google.com/dlpage/gaoptout.</a> \n      </span>\n    </p>\n    <p class=\"content-bullet-point\">\n      <!-- don't remove this empty span -->\n      <span></span> \n      <span>\n        {{'FullStory to analyze your use of our products, services, or applications – you can read more about how FullStory uses your information here:' | translate}}\n        <a href=\"https://www.fullstory.com/legal/privacy/\" target=\"_blank\">https://www.fullstory.com/legal/privacy/.</a> \n      </span>\n    </p>\n    <p class=\"detail-content\">\n      {{'Finally, we may also share your Information to comply with applicable laws and regulations, to respond to a subpoena, search warrant or other lawful request for information we receive, or to otherwise protect our rights. We may also, in other instances,share information with your express consent or at your direction.' | translate}}\n    </p>\n  </div>\n\n  <div class=\"privacy-wrapper__detail\">\n    <p class=\"detail-title\">{{'BEHAVIOURAL ADVERTISING' | translate}}</p>\n    <p class=\"detail-content\">\n      {{'As described above, we use your Information to provide you with targeted advertisements or marketing communications we believe may be of interest to you.  For more information about how targeted advertising works, you can visit the Network Advertising Initiative’s (“NAI”) educational page at' | translate}}\n      <a href=\"http://www.networkadvertising.org/understanding-online-advertising/how-does-it-work\" target=\"_blank\">http://www.networkadvertising.org/understanding-online-advertising/how-does-it-work.</a> \n    </p>\n    <p class=\"detail-content mt-4\">{{'You can opt out of targeted advertising by visiting:' | translate}}</p>\n    <p class=\"detail-content\">\n      {{'FACEBOOK - ' | translate}}\n      <a href=\"https://www.facebook.com/settings/?tab=ads\" target=\"_blank\">\n        https://www.facebook.com/settings/?tab=ads\n      </a> \n    </p>\n    <p class=\"detail-content\">\n      {{'GOOGLE - ' | translate}}\n      <a href=\"https://www.google.com/settings/ads/anonymous\" target=\"_blank\">\n        https://www.google.com/settings/ads/anonymous\n      </a>\n    </p>\n    <p class=\"detail-content\">\n      {{'BING - ' | translate}}\n      <a href=\"https://advertise.bingads.microsoft.com/en-us/resources/policies/personalized-ads\" target=\"_blank\">\n        https://advertise.bingads.microsoft.com/en-us/resources/policies/personalized-ads\n      </a>\n    </p>\n    <p class=\"detail-content\">\n      {{'Additionally, you can opt out of some of these services by visiting the Digital Advertising Alliance’s opt-out portal at: ' | translate}}\n      <a href=\"http://optout.aboutads.info/\" target=\"_blank\">http://optout.aboutads.info/.</a>  \n    </p>\n  </div>\n\n  <div class=\"privacy-wrapper__detail\">\n    <p class=\"detail-title\">{{'DO NOT TRACK' | translate}}</p>\n    <p class=\"detail-content\">\n      {{'Please note that we do not alter our Site’s data collection and use practices when we see a Do Not Track signal from your browser. \n      Instead, we offer the choices described in this policy to manage the collection and use of the Information about you.' | translate}}\n    </p>\n  </div>\n\n  <div class=\"privacy-wrapper__detail\">\n    <p class=\"detail-title\">{{'YOUR RIGHTS' | translate}}</p>\n    <p class=\"detail-content\">\n      {{'If you are an Indian resident, you have the right to access personal information we hold about you and to ask that your personal information be corrected, \n      updated, or deleted.If you would like to exercise this right, please contact us through the contact information below.' | translate}}\n    </p>\n  </div>\n\n  <div class=\"privacy-wrapper__detail\">\n    <p class=\"detail-title\">{{'DATA RETENTION' | translate}}</p>\n    <p class=\"detail-content\">{{'When you share your feedback through the Site, \n      we will maintain your UserInformation for our records unless and until you ask us to delete this information.' | translate}}</p>\n  </div>\n\n  <div class=\"privacy-wrapper__detail\">\n    <p class=\"detail-title\">{{'CHANGES' | translate}}</p>\n    <p class=\"detail-content\">\n      {{'We may update this privacy policy from time to time in order to reflect, for example, \n      changes to our practices or for other operational, legal or regulatory reasons. \n      We encourage you to review the Privacy Policy whenever you access or use the Services or otherwise interact with us to stay informed about our information practices and the ways you can help protect your privacy. \n      By continuing to use the Services after Privacy Policy changes go into effect, you agree to be bound bythe revised policy.' | translate}}\n    </p>\n  </div>\n\n  <div class=\"privacy-wrapper__detail\">\n    <p class=\"detail-title\">{{'CONTACT US' | translate}}</p>\n    <p class=\"detail-content\">\n      {{'For more information about our privacy practices, if you have questions please contact us \n      by e-mail at' | translate}} &nbsp; <a href=\"mailto:info@civis.vote\">{{'info@civis.vote' | translate}}</a> &nbsp; {{'or by mail using the details provided below:' | translate}}\n    </p>\n    <p class=\"detail-content\">\n      {{'Civis, c/o Jai Hind Building, Ist Floor, 106, Nagindas Master Road, Fort, Mumbai, Maharashtra-400001.' | translate}}\n\n    </p>\n  </div>\n\n</div>\n<app-footer></app-footer>\n");

